import React from "react";
import {
  Container,
  Text,
  PrimaryButton,
  SearchInput
} from "../../styledComponents";
import styled from "styled-components";
import HouseItem from "../HouseItem";
const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  /* justify-content: space-between; */
  padding: 30px 110px;
  background-color: white;
`;
const Wrapper = styled(Container)`
  display: flex;
  flex-wrap:wrap;
  flex-dire
  width: 100%;
  padding: 30px 110px;
`;
const Houses = () => {
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <SearchInput
            placeholder="What house are you looking for?"
            customStyles={{ width: "70%" }}
          />
        </Container>

        <PrimaryButton customStyles={{ width: 150 }}>Search</PrimaryButton>
      </SearchWrapper>
      <Wrapper>
        <Container flex={1} color="red" row customStyles={{ width: "100%" }}>
          {[
            { id: 1, name: "Barcelona" },
            { id: 2, name: "Paris" },
            { id: 3, name: "Berlin" }
          ].map(house => {
            return <HouseItem key={house.id} />;
          })}
        </Container>
      </Wrapper>
    </Container>
  );
};

export default Houses;
